import React from 'react'
import { View, Text, TextInput, TouchableOpacity } from 'react-native'
import { connect } from 'react-redux'
import { getPokemons } from '../redux/actions/pokeActions'
import styles from '../styles/styles'

const { button, buttonText, textInput, pad } = styles

type Props = {
  getPokemons: Function
  navigation: {navigate: Function}
}

const CountryForm = (props: Props) => {

  const [country, setCountry] = React.useState('')

  React.useEffect(() => {
    props.getPokemons(20)
  }, [])

  return (
    <View style={pad}>
      <TextInput style={textInput} placeholder='Enter country' onChangeText={(text: string) => setCountry(text)} value={country} />
      <TouchableOpacity style={button}  disabled={!country} onPress={() => props.getPokemons(country, props.navigation.navigate)}><Text style={buttonText}>SUBMIT</Text></TouchableOpacity>
    </View>
  )
}

export default connect(null, { getPokemons })(CountryForm)
